sanityChecks.promptOutput:
{
  "hasMaterialIssues": true,
  "overallAssessment": "The tables form a generally coherent inventory and sales model, but several critical relationship gaps and duplicated fields create ambiguity that would hinder accurate data integration.",
  "tableIssues": [
    {
      "tableName": "GoodsReceipt",
      "issueType": "missing_context",
      "severity": "high",
      "description": "The receipt table only stores po_id, warehouse and receipt date, but does not capture which products and quantities were received. This prevents linking receipts to specific purchase‑order line items.",
      "affectedTables": ["PurchaseOrderLine", "InventoryStatus"],
      "suggestedFix": "Add columns (e.g., prd_id, qty_received) or a separate receipt‑line table that references po_id and seq to record product‑level receipt details."
    },
    {
      "tableName": "Shipment",
      "issueType": "relationship_inconsistency",
      "severity": "high",
      "description": "Shipment stores ship_dt, ship_amt and status, while SalesOrder also contains ship_dt and ship_amt. It is unclear which table is the source of truth for shipping information, leading to potential data conflicts.",
      "affectedTables": ["SalesOrder"],
      "suggestedFix": "Consolidate shipping attributes into a single table (preferably Shipment) and keep only a foreign key to Shipment in SalesOrder, or clearly define which fields are authoritative."
    },
    {
      "tableName": "SalesOrder",
      "issueType": "relationship_inconsistency",
      "severity": "high",
      "description": "Redundant shipping date and amount fields duplicate those in Shipment, creating ambiguity about order fulfillment tracking.",
      "affectedTables": ["Shipment"],
      "suggestedFix": "Remove ship_dt and ship_amt from SalesOrder, referencing the related Shipment record for those details."
    },
    {
      "tableName": "InventoryAdjustment",
      "issueType": "missing_context",
      "severity": "medium",
      "description": "The column 'usr' references a user who performed the adjustment, but no User (or Employee) table is defined in the dependency level.",
      "affectedTables": [],
      "suggestedFix": "Introduce a User/Employee master table and define a foreign key from usr to that table."
    },
    {
      "tableName": "InventoryCount",
      "issueType": "missing_context",
      "severity": "medium",
      "description": "Similarly, the 'usr' column references a user without a corresponding User table, leaving the source of the count undefined.",
      "affectedTables": [],
      "suggestedFix": "Reference the same User/Employee table introduced for InventoryAdjustment."
    },
    {
      "tableName": "PurchaseOrderLine",
      "issueType": "relationship_inconsistency",
      "severity": "medium",
      "description": "The column rcv_qty stores quantity received, but there is no defined relationship to GoodsReceipt, which records receipt events at the PO level only.",
      "affectedTables": ["GoodsReceipt"],
      "suggestedFix": "Link rcv_qty updates to receipt records via a receipt‑line table or add a foreign key from PurchaseOrderLine to GoodsReceipt (or its line details)."
    },
    {
      "tableName": "OrderLineItem",
      "issueType": "terminology",
      "severity": "low",
      "description": "The primary key is oli_id while a separate seq column also indicates line order. The purpose of seq is unclear because uniqueness is already guaranteed by oli_id.",
      "affectedTables": [],
      "suggestedFix": "Either make (ord_id, seq) the composite primary key and drop oli_id, or clarify that seq is for display ordering only."
    }
  ],
  "crossTableObservations": [
    {
      "observation": "Multiple tables reference a 'usr' or user identifier without a defined User entity, indicating a missing master table for system users.",
      "tables": ["InventoryAdjustment", "InventoryCount"]
    },
    {
      "observation": "Shipping information is split between SalesOrder and Shipment, leading to duplicated fields and potential inconsistencies in order fulfillment tracking.",
      "tables": ["SalesOrder", "Shipment"]
    },
    {
      "observation": "Receipt granularity is inconsistent: GoodsReceipt captures only PO‑level data, while PurchaseOrderLine tracks received quantity per line, but no explicit link exists.",
      "tables": ["GoodsReceipt", "PurchaseOrderLine"]
    }
  ]
